import React from 'react';
import { Link } from 'react-router-dom';
import './CSS/Search.css'
import {uid} from 'react-uid';

class Search extends React.Component{
    render(){
        return(
            <div>
                <SearchBar/>
                <TableResults/>
            </div>
        )

    }
}

class TableResults extends React.Component{

    state = {
        lists:[
            {listName : "Beverages", 
            listDescript : "bvwgriughuiehfieuwhfueiwfhiewufhiewufhuewhfiuwfhewff",
            username : "johnSmith12"},

            {listName : "Dishes", 
            listDescript : "bvwgriughuiehfieuwhfueiwfhiewufhiewufhuewhfiuwfhewff",
            username : "johnSmith12"},

            {listName : "Candy", 
            listDescript : "bvwgriughuiehfieuwhfueiwfhiewufhiewufhuewhfiuwfhewff",
            username : "johnSmith12"},
        ]
    }


    TableRow(row){
        return(
            <tr key={uid(row)}>
                <td>
                    <strong>{row.Rank}</strong>
                </td>
                <td>
                    <strong>{row.FoodName}</strong>
                </td>
                <td>
                    <strong>{row.Notes}</strong>
                </td>
            </tr>
        )
    }

    render(){
        return(
            <div>
            <table>
                <tbody>
                <tr>
                    <th>List Name</th>
                    <th>List Description</th>
                    <th>Username</th>
                    {this.state.lists.map(row => {return this.TableRow(row)})}
                </tr>
                </tbody>
            </table>
            </div>
        )
    }
}



class SearchBar extends React.Component{
    render(){
        return(
            <div id="searchBarDiv">
            <form>
                <input type="text" id="searchBarText"></input>
                <input type="submit" id="searchBarButton" value ="Search"></input>
            </form>
            </div>
        )
    }
}


export default Search;
